import axios from "axios";
import React, { useEffect, useState } from "react";
// import "./All.css";
// import AiOutlineArrowLeft from 'react-icons/AiOutlineArrowLeft'
import { AiOutlineArrowLeft } from "react-icons/ai";
import url from "../host";

export default function Manager() {
  const [data, setData] = useState([]);
  useEffect(() => {
    var tokenUser = localStorage.getItem("token");
    axios
      .get(`${url}/api/myzakaz`, {
        headers: { Authorization: "Bearer: " + tokenUser },
      })
      .then((res) => {
        setData(res.data);
        console.log(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  function handlePress() {
    document.querySelector(".MainS").style = "display: none";
    document.querySelector(".opacityDiv").style = "display: block";
  }

  function handlePress2() {
    document.querySelector(".MainS").style = "display: block";
    document.querySelector(".opacityDiv").style = "display: none";
  }
  function handlePress3() {
    document.querySelector(".addOrder").style = "display: block;";
  }
  function handlePress4() {
    document.querySelector(".addOrder").style = "display: none;";
  }
  return (
    <div style={{ width: "100%" }}>
      <div className="opacityDiv">
        <h4 onClick={() => handlePress2()}>
          <AiOutlineArrowLeft style={{ fontSize: 30, cursor: "pointer" }} />
        </h4>
        <h1 style={{ marginLeft: "10%" }}>Обновить заказ</h1>
        <div style={{ paddingLeft: 140 }}>
          <div
            style={{
              display: "flex",
              justifyContent: "space-around",
              alignItems: "center",
            }}
          >
            <div style={{ width: "40%" }}>
              <span>Отправитель</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
            <div style={{ width: "40%" }}>
              <span>Получатель</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
          </div>
          <div
            style={{
              display: "flex",
              justifyContent: "space-around",
              alignItems: "center",
              // height: 120
            }}
          >
            <div style={{ width: "40%" }}>
              <span>Адрес</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
            <div style={{ width: "40%" }}>
              <span>Адрес</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
          </div>
          <div
            style={{
              display: "flex",
              justifyContent: "space-around",
              alignItems: "center",
            }}
          >
            <div style={{ width: "40%" }}>
              <span>Трек-код</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
            <div style={{ width: "40%" }}>
              <span>email</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
          </div>
          <button
            style={{
              background: "#800000",
              border: "none",
              height: 40,
              borderRadius: 5,
              color: "white",
              fontWeight: "400",
              fontSize: 17,
              marginLeft: 50,
              marginTop: 10,
            }}
          >
            Обновить заказ
          </button>
        </div>
      </div>
      <div className="addOrder">
      <AiFillCloseCircle
        className="iconCLose"
        onClick={() => handlePress4()}
      />
      <select
        className="select1"
        style={{ width: "100%", height: 35, marginTop: 10 }}
      >
        {managers.map((item) => {
          return <option value={item.id}>{item.firstname}</option>;
        })}
      </select>
      <textarea
        style={{ maxWidth: "98%", minWidth: "98%", marginTop: 10 }}
        placeholder="desckription"
        className='textarea'
      />
      <select
        onChange={(e) => {
          console.log(JSON.parse(e.target.value));
          setTarget(JSON.parse(e.target.value).sender);
          setSelectedAddress(JSON.parse(e.target.value).insender);
        }}
        className="select2"
        style={{ width: "100%", height: 35, marginTop: 10 }}
      >
        {order.map((item) => {
          return <option value={JSON.stringify(item)}>{item.trek_id}</option>;
        })}
      </select>
      <h1>{selectedAddress.map((item) => item.sender)}</h1>
      <button onClick={() => handlePress5()}>Add</button>
    </div>
      <div className="MainS" style={{ width: "100%" }}>
        <div className="adminPage1">
          <h1>Все заказы</h1>
          <div className="inpForm1">
            <button
              style={{
                width: 120,
                height: 35,
                borderRadius: 5,
                border: "none",
                background: "#ccc",
                color: "white",
              }}
              onClick={() => handle}
            >
              Новый заказ
            </button>
          </div>
        </div>
        <div className="bigOrder">
          <div className="mainOrder">
            {data.map((item) => {
              return (
                <div className="minOrder" onClick={() => handlePress()}>
                  <div
                    style={{
                      display: "flex",
                      // alignItems: "center",
                      // justifyContent: "space-between",
                      width: "30%",
                    }}
                  >
                    <img src="https://github.com/twbs.png" alt="" />
                    <div>
                      <h1 style={{ height: "7px" }}>{item.oreder.trek_id}</h1>
                    </div>
                  </div>
                </div>
              );
            })}

            {/* <div className="minOrder">
            <img src="https://github.com/twbs.png" alt="" />
            <h1>YT8929328214977</h1>
          </div> */}
          </div>
        </div>
      </div>
    </div>
  );
}
